if not exists (select 1 from sys.tables where name ='DQEGraphAnnotation') 
begin
CREATE TABLE [dbo].[DQEGraphAnnotation](
	[ID] [int] IDENTITY(1,1) NOT NULL,
	[StartX] [float] NOT NULL,
	[StartY] [float] NOT NULL,
	[EndX] [float] NOT NULL,
	[EndY] [float] NOT NULL,
	[Text] [varchar](500) NOT NULL,
	[Evaluation_ID] [int] NOT NULL,
	[Username] [varchar](500) NOT NULL,
	[CreationDate] [datetime] NOT NULL,
	[AnnotationIsForGraph] [varchar](100) NOT NULL,
 CONSTRAINT [PK_DQEGraphAnnotation] PRIMARY KEY CLUSTERED 
(
	[ID] ASC
)WITH (PAD_INDEX = OFF, STATISTICS_NORECOMPUTE = OFF, IGNORE_DUP_KEY = OFF, ALLOW_ROW_LOCKS = ON, ALLOW_PAGE_LOCKS = ON) ON [PRIMARY]
) ON [PRIMARY]

ALTER TABLE [dbo].[DQEGraphAnnotation]  WITH CHECK ADD  CONSTRAINT [FK_DQEGraphAnnotation_Evaluation] FOREIGN KEY([Evaluation_ID])
REFERENCES [dbo].[Evaluation] ([ID])
ON DELETE CASCADE

ALTER TABLE [dbo].[DQEGraphAnnotation] CHECK CONSTRAINT [FK_DQEGraphAnnotation_Evaluation]

end


if not exists (select 1 from sys.tables where name ='sysdiagrams') 
begin
--Diagrams
CREATE TABLE [dbo].[sysdiagrams](
	[name] [sysname] NOT NULL,
	[principal_id] [int] NOT NULL,
	[diagram_id] [int] IDENTITY(1,1) NOT NULL,
	[version] [int] NULL,
	[definition] [varbinary](max) NULL,
PRIMARY KEY CLUSTERED 
(
	[diagram_id] ASC
)WITH (PAD_INDEX = OFF, STATISTICS_NORECOMPUTE = OFF, IGNORE_DUP_KEY = OFF, ALLOW_ROW_LOCKS = ON, ALLOW_PAGE_LOCKS = ON) ON [PRIMARY],
 CONSTRAINT [UK_principal_name] UNIQUE NONCLUSTERED 
(
	[principal_id] ASC,
	[name] ASC
)WITH (PAD_INDEX = OFF, STATISTICS_NORECOMPUTE = OFF, IGNORE_DUP_KEY = OFF, ALLOW_ROW_LOCKS = ON, ALLOW_PAGE_LOCKS = ON) ON [PRIMARY]
) ON [PRIMARY] TEXTIMAGE_ON [PRIMARY]

EXEC sys.sp_addextendedproperty @name=N'microsoft_database_tools_support', @value=1 , @level0type=N'SCHEMA',@level0name=N'dbo', @level1type=N'TABLE',@level1name=N'sysdiagrams'

end

